function ShowTimes() {
    return(
        <div className='show-times'></div>
    );
}

function ShowNames() {
    return(
        <div className='show-names'></div>
    );
}

export default function Shows() {
    return(
        <>
            <ShowTimes/>
            <ShowNames/>
        </>
    );
}
